import React from 'react'
import Home from './pages/Home'
import News from './pages/News'


function App() {
  return (
    <div className="App">
      <div className="Home">
        <Home />
      </div>

      <div className="News">
        <News />
      </div>     

    </div>
  );
}

export default App;
